function hex2dec(i) {

  // Return 0 if number is not hexadecimal or contains more than ten characters (10 digits)

  if (!/^[0-9A-Fa-f]{1,10}$/.test(i)) return '0';



  // Convert hexadecimal number to decimal

  var decimal = parseInt(i, 16);



  // Return decimal number

  return (decimal >= 549755813888) ? decimal - 1099511627776 : decimal;

}

