function remove_non_ascii(str) {

  if ((str===null) || (str==='')){
       return false;
  }
else{
   var str=str.toString();
  var str1=str.replace(/[^\x20-\x7E]/g, '');
  var str2=str1.substring(str1.length-8,str1.length+8);


  return str2;
}
